import React from "react";

function DataArea(props) {
  return (
    <ul className="list-group">
      <li className="list-group-item">
        <img alt={props.result.name} className="img-fluid" src={props.result.picture.thumbnail}/>
        <span>
        {props.result.picture.name}
        {props.result.picture.thumbnail}
        {props.result.picture.thumbnail}
        {props.result.picture.thumbnail}
        </span>
      </li>
    </ul>
  );
}

export default DataArea;
